  false,\n\t\"url\": null,\n\t\"notes\": \"During the summer of 2012, the Montana
  Ecological Services Environmental Contaminants Program measured various field water
  quality parameters and collected surface water and sediment samples from various
  water bodies found throughout the Charles M. Russell Wetland Management District
  (CMRWMD) for selenium analysis. In addition to those measurements taken in 2012,
  field water quality parameters that were collected at Tew and Spidel WP A's as part
  of the CMRWMD contaminant assessment process in 2011 were also included. This report
  is on the results and discussion of the findings from the selenium analysis.\",\n\t\"license_title\":
